import * as React from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import { Typography } from '@mui/material';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';

const DashboardPage = () => {
    return (
        <div>
            <Stack spacing={2}>
                <Typography sx={{ fontSize: '2rem', color: '#185382', marginLeft: '1rem' }}>Dashboard</Typography>
                <Button variant="contained" color="#185382">Daily Stand-up Meeting</Button>
            </Stack>
            <Box sx={{ flexGrow: 1, marginLeft: '1rem' }}>
                <Grid container spacing={2}>
                    <Grid item xs={4}>
                        <Typography>List Image</Typography>
                    </Grid>
                    <Grid item xs={8}>
                        <Typography>Project</Typography>
                    </Grid>
                </Grid>
            </Box>
        </div>
    );
}
export default DashboardPage
